Sim, preta, achou forte ? Mas não é forte quando se fala: "Pele branca" ?
Pele preta, pele negra, pele escura, queria muito ter; se eu não tenho medo do preconceito? 
Não!
Não tenho, eu acho lindo, cabelos crespo?
Se você não acha lindo, desculpa, não ligo para sua opinião! 
Meu avô era negro, a pele bem escura, coisa linda, meus pais são brancos, eu tive o prazer de nascer morena dos cabelos cacheados.
Mas queria ter nascido com a cor de pele do meu avô, eu não ligo para seu preconceito, eu não ligo para as ofensas que vem da boca de um racista, eu considero inveja, uma pessoa infeliz que tenta atingir uma pessoa feliz! 
Queria muito que não existisse racismo, mas infelizmente existe, lutamos contra isso todos os dias, eu acho lindo um negro sendo astro de cinema, cantor(ar), um negro em cargo político, eu sinto orgulho!!! 
As curvas de uma mulher negra, é uma obra de arte, seu gingado ao dançar, as curvas do seu cabelo acompanham as ondas do mar.
Não tô diminuindo a cor branca ou parda, são lindas também.
Mas meu foco é minhas origens, é por tal cor que sou tão apaixonada, é por tal cor que eu lutaria até a morte.
Todas as cores de pele tem meu respeito, queria seu respeito também, aceitar cada pedacinho do corpo de um negro e de um branco.
Sou morena sim! Meu cabelo é enrolado! Meu cabelo é escuro! 
Eu amo isso, eu amo a cor preta, a cor branca, a parda, o cabelo ruivo ou loiro, seja qual for sua cor, se orgulhe dela e tenha orgulho das outras. 
Você pode ser de uma cor, mas seu filhos podem nascer de outra, por isso cuidado com o que você fala! 
(Alice Bernardo Pires)
